            width:'250px' 

          }}>

            <h1 style={{color: "#1e8785"}}>Welcome to TouristClub!!!</h1>
            <h4 style={{color: "#15adaa"}}>Best place for travel enthusiasts.</h4>
            <hr />
        <img src={img1}></img>
    </div>

    );
}

export default Home;
